import React, { Component} from 'react';
import { connect } from 'react-redux'
import { Navbar,Container,Nav ,Image} from 'react-bootstrap';
import { logOut } from '../actions/authedUser';
class Home extends Component {
    handleLogOut=(e)=>{
        e.preventDefault();
        this.props.dispatch(logOut())
    }
    render() { 
        const {authedUser,users} = this.props
        const user = users[authedUser]
        return (

          
            <Navbar>
            <Container>
              <Navbar.Brand href="#home">Would You ?</Navbar.Brand>
              <Nav className="me-auto">
                <Nav.Link href="#home" active>Home</Nav.Link>
                <Nav.Link href="#features">New Question</Nav.Link>
                <Nav.Link href="#pricing">Leader Board</Nav.Link>
              <Navbar.Toggle />
              {authedUser ?
              <Navbar.Collapse className="justify-content-end">
                <Navbar.Text>
                Hello, {user.name}
                </Navbar.Text>
                <Image style={{width:'25px',height:'25px', backgrounColor:'#fff'}} rounded src={user!== 'undefined' ? user.avatarURL : 'logo'}/>
              </Navbar.Collapse> :<div></div>}
              </Nav>
            </Container>
          </Navbar>
          
        );
    }
}
function mapStateToProps ({authedUser,users}) {
    return {
        authedUser,
        users
    }
} 
export default connect(mapStateToProps)(Home);
